contracts/Consorcio.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./Employee.sol";
import "./Tenant.sol";

contract Consorcio is Ownable {

    event PaymentSucessfully(address from, uint256 amount);

    struct Service {
        string name;
        uint price;
    }

    Employee[] private employeeList;
    Tenant[] private tenantList;
    Service[] private serviceList;

    receive() external payable {}
    fallback() external payable {}


    function getPayer(address _userAddress) private view returns(bool){
        for(uint i = 0; i < tenantList.length; i++) {
            if(tenantList[i].withdrawAddress() == _userAddress) {
                return true;
            }
        }
        return false;
    }

    modifier isPayer() {
        require(getPayer(msg.sender), 'You are not a valid user to make payments');
        _;
    }

    modifier paid() {
        _;
        emit PaymentSucessfully(msg.sender, msg.value);
    }



    function paySalaries() public payable onlyOwner {
        for(uint i = 0; i < employeeList.length; i++) {
            (bool success,) = address(employeeList[i].withdrawAddress()).call{value: msg.value}("");
            require(success, "Transfer failed.");
        }
    }

    function payAllServices() public onlyOwner {}

    function payService(uint index) public onlyOwner {}

    function addNewTenant(string memory _name, address _tenantAddress, uint _rentalCost, string memory _residence) public onlyOwner {
        tenantList.push(new Tenant(_name, _tenantAddress, _rentalCost, _residence, address(this)));
    }

    function addNewEmployee(string memory _name, address _employeeAddress, string memory _profession, uint _salary) public onlyOwner {
        employeeList.push(new Employee(_name, _employeeAddress, _profession, _salary));
    }

    function addNewService(string memory _name, uint _price) public onlyOwner {
        serviceList.push(Service(_name, _price));
    }
    
    function showContractAddress() public view returns(address) {
        return address(this);
    }

    function getContractBalance() public view returns(uint256 balance) {
        return address(this).balance;
    }
}

contracts/Tenant.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./BaseUser.sol";

contract Tenant is BaseUser {

    uint private servicePrice;
    string private buildingAddress;
    address private consorcioAddress;

    event ExpensesPaid(uint pricePaid);
    event EtherReceived(uint amount);

    receive() external payable {}
    fallback() external payable {}

    constructor (
        string memory name,
        address newWithdraAddress,
        uint price,
        string memory newBuildingAdd, 
        address newConsorcioAdd
    ) payable BaseUser (name, newWithdraAddress)  {
        
        servicePrice = price;
        buildingAddress = newBuildingAdd;
        consorcioAddress = newConsorcioAdd;
    }

    function deposit() public payable {
        emit EtherReceived(msg.value);
    }

    function payExpenses() public {
        require(address(this).balance >= servicePrice, "Fondos insuficientes");
        (bool sent,) = consorcioAddress.call {
            value: servicePrice
        }("");
        require(sent == true, "Fallo la transferencia");
        emit ExpensesPaid(servicePrice);
    }

}

contracts/Employee.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./BaseUser.sol";


contract Employee is BaseUser {

    string private profession;
    uint private salary;

    constructor(
        string memory newName,
        address newAddress,
        string memory newProfession, 
        uint _salary
        ) BaseUser(newName, newAddress) {
        profession = newProfession;
        salary = _salary;
    }

}

